import React from "react";
import Nav from "./components/Nav";
import About from "./components/About";
import Gallery from "./components/Gallery";
import Footer from "./components/App/Footer/Footer";

function App() {
  return (
    <>
      <Nav />
      <About />
      <Gallery />
      <section id="appointment">
        <AppointmentForm />
      </section>
      <Footer />
    </>
  );
}

export default App;
